import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Button from '@mui/material/Button';
import Grid from '@mui/material/Grid';
import EastIcon from '@mui/icons-material/East';
import { EmployeePaymentUpdate, EmployeeSubscribe, EmployeeSubscriptionCreate, EmployeeSubscriptionTrail } from '../../../sevices/account';
import { Spin } from 'antd';
import { ENV_CONFIG } from '../../../constant';
const SubscriptionPlans = (props) => {
    // let localinfo = props.userData.userdata.response.data.details
    let bankInfo = props?.userData?.bankData
    const [UserData, setUserData] = useState({})
    const [subscriptionData, setsubscriptionData] = useState({})
    const [loading, setLoading] = useState(false);
    const [subscriptionPlan, setsubscriptionPlan] = useState('')
    const [payment, setPayment] = useState('');
    const stripe = require('stripe')(ENV_CONFIG.STRIPE_KEY);
    const Employee = async () => {
        const body = {};
        // body.email = localinfo?.email;
        // body.employee_id = localinfo?.employee_id;

        // body.account_number = bankInfo?.account_number;
        // body.account_type = bankInfo?.account_type;
        // body.account_holder_name = bankInfo?.account_holder_name;
        // body.IFSC_code = bankInfo?.IFSC_code;


        try {
            const response = await EmployeeSubscriptionTrail(body);
            if (response.status === 200) {
                const URL = response.data.details.url
                window.location.href = URL;
            }
        } catch (error) {
            console.error('Subscriptionerror:', error);
        }
    };

    useEffect(() => {
        // let UserDeatails = localinfo
        // setUserData(UserDeatails)
        priceView()

    }, []);


    const priceView = async () => {
        const productKey = ENV_CONFIG.PARTTIMER_PRODUCT_KEY;
        try {
            const product = await stripe.products.retrieve(productKey);

            if (product) {
                setsubscriptionPlan(product?.name)
                const priceid = product?.default_price
                const priceDetails = await stripe.prices.retrieve(priceid);

                setPayment(priceDetails?.unit_amount)
            }

        } catch (error) {
            console.error('Error retrieving product:', error);
        }
    }



    const navigate = useNavigate();
    const redirectDahboard = () => {
        //navigate("/dashboard")
    }
    return (
        <div className="WizardFormContainer">
            <div className="title">Subscription Plans</div>
            <Grid container spacing={2.5}>
                <Grid item xs={12} sm={5}>
                    <div className="subscriptionCard">
                        <img src={require('../../../assets/images/money-icon.png')} className="moneyIcon" />
                        <div className="cardTitle">{subscriptionPlan}</div>
                        <div className="subscriptionAmount">
                            â‚¹{payment / 100} / year
                        </div>
                        <div className="cardContent">
                            This plan typically provides access
                            to job search functionalities such
                            as the ability to view and apply for
                            jobs, receive job alerts, and track
                            applications. It may also offer
                            additional features such as
                            resume review, personalized
                            job recommendations.
                        </div>
                    </div>
                </Grid>
                <Grid item xs={12} sm={7}>
                    <div className="subscriptionCardRight">

                        <div className="subscriptionCardCheckListContainer">
                            <div className="subscriptionCardCheckListSet">
                                <img src={require('../../../assets/images/check-icon.png')} alt="" />
                                <span>
                                    <strong>Job Search:</strong> This feature provides job seekers with the ability to
                                    search for job listings based on their preferred criteria, such as
                                    location, industry, job type, and salary range.
                                </span>
                            </div>
                            <div className="subscriptionCardCheckListSet">
                                <img src={require('../../../assets/images/check-icon.png')} alt="" />
                                <span>
                                    <strong>Application Tracking:</strong> This feature allows job seekers to track
                                    the status of their job applications, such as whether their
                                    resume has been viewed, whether they have been shortlisted
                                    for an interview, and whether they have been offered a job.
                                </span>
                            </div>
                            <div className="subscriptionCardCheckListSet">
                                <img src={require('../../../assets/images/check-icon.png')} alt="" />
                                <span>
                                    <strong>Job Alerts:</strong> This feature sends job seekers alerts when new
                                    job listings that match their criteria are posted.
                                </span>
                            </div>
                            <div className="subscriptionCardCheckListSet">
                                <img src={require('../../../assets/images/check-icon.png')} alt="" />
                                <span>
                                    <strong>Company Reviews:</strong> Some job portals provide job seekers with
                                    access to company reviews and ratings, which can help them to
                                    research potential employers and make informed decisions about
                                    which companies to apply to
                                </span>
                            </div>
                        </div>

                        <Button variant="contained" color="primary" className="SubscriptionBtn" onClick={Employee}>
                            <span>Pay Now</span>
                            <EastIcon />
                        </Button>
                    </div>
                </Grid>
            </Grid>

        </div>
    );
}

export default SubscriptionPlans;
